import { useCallback } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import React, { useEffect, useState } from "react"

const PostData = async(e)=>{

  if(user.email_id!="" && user.password!=""){

  e.preventDefault();
  const{email_id,password} = user;
  const res = fetch("login/log",{
    method:"POST",
    headers:{
      "content-Type":"application/json"
    },
    body:JSON.stringify({
      email_id,password
    }),


  }).then((response)=>{
    if(response.status==200)
    {
      alert("Login sucessful")
      onContinueClick();
      console.log(user)
    }
    else if(response.status==401)
    {
      alert("Wrong username or password")
    }
    else if(response.status==404||response.status==403)
    {
      alert("Sorry not found")
    }


  })}



}

import "./UserPage.css";
const baseURL = "http://localhost:5000/users/64479515dc113b2ad1b24e59";

const UserPage = () => {
  const navigate = useNavigate();

  const onFrameButtonClick = useCallback(() => {
    navigate("/bank");
  }, [navigate]);

  const onHeaderClick = useCallback(() => {
    navigate("/");
  }, [navigate]);

  const onMicrosoftTeamsImage12Click = useCallback(() => {
    navigate("/");
  }, [navigate]);
  const [ User, setuser] = React.useState(null);

  React.useEffect(() => {
    axios.get(baseURL).then((response) => {
      setuser(response.data);
    });
  }, []);

  if (!User) return null;
  else{
    const val=User.email
    console.log(val)
  }

  return (




    <div className="user-page">
        <div className="user-page-child" />
        <div className="icon-user-parent">
          <img className="icon-user" alt="" src="/-icon-user.svg" />
          <div className="priyanshu-priyanshugmailcom-container">
            <span className="priyanshu-priyanshugmailcom-container1">
              <p className="priyanshu">Priyanshu</p>
               <p className="priyanshu">val</p>
              <p className="priyanshu">+91 9765334578</p>
              <p className="priyanshu">DOB- 01/07/2001</p>
            </span>
          </div>
        </div>
        <div className="your-claim-status-parent">
          <div className="your-claim-status">Your Claim Status</div>
          <div className="frame-child" />
        </div>
        <button className="file-claim-wrapper" onClick={onFrameButtonClick}>
          <div className="file-claim">File Claim</div>
        </button>
        <button className="header4" onClick={onHeaderClick}>
          <img className="logo-icon5" alt="" src="/logo3@2x.png" />
        </button>
        <div className="frame-parent">
        <><div class="tableFixHead">
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>Policy Type</th>
            <th>Claim Status</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>11-10-2020</td>
            <td>Term Life</td>
            <td>Claimed</td>
          </tr>
          <tr>
            <td>05-07-2021 </td>
            <td>Bike</td>
            <td>Rejected</td>
          </tr>
          <tr>
            <td>08-09-2022</td>
            <td>Medical</td>
            <td>Claimed</td>
          </tr>
          <tr>
            <td>02-03-2023</td>
            <td>Car</td>
            <td>Pending</td>
          </tr>
          <tr>
            <td> </td>
            <td> </td>
            <td> </td>
          </tr>
          <tr>
            <td> </td>
            <td> </td>
            <td> </td>
          </tr>
          <tr>
            <td> </td>
            <td> </td>
            <td> </td>
          </tr>
        </tbody>
      </table>
    </div></>
        </div>
        <div className="img-container">
        <div className="fixed-rectangle">
          <img className="img-icon7" alt="" src="/img.svg" />
          <button
            className="microsoftteams-image-1-27"
            onClick={onMicrosoftTeamsImage12Click} />

          <div className="contact-us-parent4">
            <div className="contact-us7">Contact US</div>
            <div className="email-claimlygmailcom7">Email: claimly@gmail.com</div>
            <div className="ph-no-917">Ph No: +91 876543210</div>
          </div>
          <img className="group-child17" alt="" src="/frame-3424.svg" />
        </div>
        </div>
      </div>
  );
};

export default UserPage;
